import products from '../menu';

const ShopProduct = (props) => {
    const name = props.match.params.productId;
    const juice = products.filter(product => product.linkUrl === name);


    return (
        <div>
            <h1>{juice.name}</h1>

        </div>
    );
};

export default ShopProduct;
